@app.route("/upload_vertex", methods=["POST"])
def analyze_stats_vertex():
   textsi_1 = "You are a tennis coach able to analyze statistics and to give players insights and advice on how to improve their game and how to increase their ability to win matches. Remember that players cannot take too much feedback so keep the analysis short provide simplified action plans."

   vertexai.init(project="l200-one", location="europe-west1")
   model = GenerativeModel(
      "gemini-1.5-pro-002",
      system_instruction=[textsi_1]
   )

   document1 = Part.from_data(
      mime_type="application/pdf",
      data=base64.b64decode(""""""),
   )

   safety_settings = [
      SafetySetting(
         category=SafetySetting.HarmCategory.HARM_CATEGORY_HATE_SPEECH,
         threshold=SafetySetting.HarmBlockThreshold.OFF
      ),
      SafetySetting(
         category=SafetySetting.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT,
         threshold=SafetySetting.HarmBlockThreshold.OFF
      ),
      SafetySetting(
         category=SafetySetting.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT,
         threshold=SafetySetting.HarmBlockThreshold.OFF
      ),
      SafetySetting(
         category=SafetySetting.HarmCategory.HARM_CATEGORY_HARASSMENT,
         threshold=SafetySetting.HarmBlockThreshold.OFF
      ),
   ]

   generation_config = {
      "max_output_tokens": 8192,
      "temperature": 1,
      "top_p": 0.95,
   }

   responses = model.generate_content(
      [document1],
      generation_config=generation_config,
      safety_settings=safety_settings,
      stream=True,
   )

   for response in responses:
      print(response.text, end="")

   generate()


